INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('99534592', 'Saumon à l\'oseille', '\'1/1/1/ Riz basmati accompagné d\'une sauce à l\'oseille et dun filet de saumon Conseil de préparation Au four à micro-ondes : percez le film des sachets. Mettez les 3 sachets dans le four à micro-ondes et réchauffez 2 minutes 30 à 750 Watts. Retirez l\'exsudat du poisson avant de servir Ingrédients Sachet de riz (132 g) : 45 % riz basmati cuit (eau, riz), sel. Sachet de sauce (88 g) : eau, crème (lait) (crème de lait, stabilisant : carraghénanes), lait demi-écrémé, vin blanc, 2 % oseille, échalote, vinaigre dialcool, amidon modifié de manioc, sel, arôme naturel (contient poissons), épaississants : gomme xanthane, gomme guar ; poivre, curcuma Sachet de saumon (70 g) : 24 % filet de saumon (poisson). Pourcentages exprimés sur le total de la recette, Traces éventuelles de crustacés, de mollusques, d\'Œufs, de soja, de céleri, de moutarde, de fruib à coque, de céréales contenant du gluten et de graines de sésame.', '', '4', '1.8', '12', '0.1', '', '8.2', '0.64', '0.251968503937008', '', '1');

